The graph of a quadratic function is shown in the xy-plane. Which of the following equations could represent this function?

[asy]
unitsize(0.6 cm);

real func (real x) {
    return(-0.5*(x + 2)^2 + 4);
}

draw(graph(func,-5,1),linewidth(1.2));
draw((-5,0)--(1,0),Arrow(6));
draw((0,-1)--(0,5),Arrow(6));

label(\
